import React from 'react';
import styled from 'styled-components'

const Bodywrapper = styled.body `
background-color: #2A2F36; 
margin: 300px;
padding: 10px;
`




function Body() {
  return (
      <Bodywrapper>

      </Bodywrapper>

  );
}

export default Body;
